import React from 'react';
import { Link } from 'react-router-dom'; // Importe o componente Link
import { Container, TextField, Button, Grid, AppBar, Toolbar } from '@mui/material';
import FacebookLogin from 'react-facebook-login';
import GoogleLogin from 'react-google-login';

const LoginScreen = () => {
  // ... Outro código ...

  return (
    <div>
      {/* ... AppBar e outros conteúdos ... */}

      {/* Botão de login com Google */}
      <GoogleLogin
        clientId="SEU_CLIENT_ID_DO_GOOGLE"
        onSuccess={handleGoogleLoginSuccess}
        onFailure={handleGoogleLoginFailure}
        buttonText="Login com Google"
      />

      {/* Botão de login com Facebook */}
      <FacebookLogin
        appId="SEU_APP_ID_DO_FACEBOOK"
        fields="name,email,picture"
        callback={handleFacebookLogin}
        textButton="Login com Facebook"
      />

      {/* Botão de redirecionamento para a página de cadastro */}
      <Link to="/cadastro" style={{ textDecoration: 'none' }}>
        <Button variant="contained" color="secondary" fullWidth style={{ marginTop: '20px', backgroundColor: 'rgb(215, 56, 55)' }}>
          Criar uma conta
        </Button>
      </Link>
    </div>
  );
}

export default LoginScreen;
